import React from "react";
import { useDispatch } from "react-redux";
import DropdownAction from "~/components/elements/basic/DropdownAction";
import styles from "../TableExtraStyles/extraStyles.module.css";

function BidColumn({bid, num}) {
	const dispatch = useDispatch();

      const approveEvent = ()=>{
            console.log('approve event')
            dispatch(bid.id)
      }



	return (
		<tr>
			<td>{num + 1}</td>
			<td>
				<strong>{bid.product_id}</strong>
			</td>
			<td>{bid.start_time}</td>
			<td>{bid.access_amount}</td>
			<td>{bid.minimum_amount}</td>
			<td>{bid.createdAt}</td>
			{/* <td>{badgeView}</td> */}
			<td>
				<button onClick={approveEvent} className={styles.createEventButton}>Approve Event</button>
			</td>
			<td>
				<DropdownAction type="bid" id={bid.id} key={num + 1} />
			</td>
		</tr>
	);
}

export default BidColumn;
